      logo: LogoFlutter,
      avatar: AvatarMeng,
      background: itemCourseImage,
    },

  ]
  const listItems = numbers.map((item) => <CourseItem
    title={item.title}
    description={item.description}
    customStyles={{ margin: 20 }}
  />)
  return (
    <ul className="row">
      {listItems}
    </ul>
  )
}
export default MyCourses
